import React, { useState, useEffect } from 'react';
import { Link } from "react-router-dom";
function OrderList() {
  const [orders, setOrders] = useState([]);
  useEffect(() => {
    fetchData();
  }, []);
  const fetchData = async () => {
    try {
      //const response = await axios.get('/api/orders'); // You need to define your endpoint
      //setOrders(response.data);
      // Assuming the data structure returned from the API is an array of orders
      const data = [
      ];
      setOrders(data);
    } catch (error) {
      console.error('Error fetching data: ', error);
    }
  };
  const handleButtonClick = (id, status) => {
  };
  return (  
    <div>
        <div className="bg-secondary border-top p-5 text-white mb-3">
              <Link to="/">
                <img alt="logo" src="../../images/(0).png" style={{ marginLeft : "150px", height: "44px", width: "159px" }} />
              </Link>
          <h1 className="display-6 text-center" style={{marginTop: "-45px"}}>Manage Orders</h1>
          <button className="btn btn-dark btn-block float-end">
                <Link to="/account/signinadmin" className="text-white" style={{color : "white", textDecoration : "none", fontSize : "18px"}}>
                  Logout
                </Link>
              </button>
        </div>
    <div style={{padding:"40px"}}>
      <div className="table-responsive">
        <table className="table table-striped table-bordered table-hover table-condensed" width="80%" align="center">
          <thead>
            <tr>
              <th style={{backgroundColor:"black",color:"white"}}><center>Order ID</center></th>
              <th style={{backgroundColor:"black",color:"white"}}><center>Order Date</center></th>
              <th style={{backgroundColor:"black",color:"white"}}><center>Product Name</center></th>
              <th style={{backgroundColor:"black",color:"white"}}><center>Product Price</center></th>
              <th style={{backgroundColor:"black",color:"white"}}><center>Shipping Address</center></th>
              <th style={{backgroundColor:"black",color:"white"}}><center>Shipping Status</center></th>
            </tr>
          </thead>
          {orders && orders.length > 0 ? (
            <tbody>
              {orders.map(order => (
                <tr key={order.orderId}>
                  <td><center>{order.orderId}</center></td>
                  <td><center>{order.orderDate}</center></td>
                  <td><center>{order.productName}</center></td>
                  <td><center>{order.productPrice}</center></td>
                  <td><center>{order.shippingAddress}</center></td>
                  <td>
                    <center>
                      {order.shippingStatus}
                        <button onClick={() => handleButtonClick(order.orderId, 'Order Confirmed')} className="btn btn-primary btn-md text-white" style={{ backgroundColor: 'black', margin: '10px', borderColor:'black' }}>Order Confirmed</button>
                        <button onClick={() => handleButtonClick(order.orderId, 'Shipped')} className="btn btn-primary btn-md text-white" style={{ backgroundColor: 'black', marginRight: '10px', borderColor:'black' }}>Shipped</button>
                        <button onClick={() => handleButtonClick(order.orderId, 'Out for Delivery')} className="btn btn-primary btn-md text-white" style={{ backgroundColor: 'black', marginRight: '10px', borderColor:'black' }}>Out for Delivery</button>
                        <button onClick={() => handleButtonClick(order.orderId, 'Delivered')} className="btn btn-primary btn-md text-white" style={{ backgroundColor: 'black', borderColor:'black' }}>Delivered</button>
                      
                    </center>
                  </td>
                </tr>
              ))}
            </tbody>
          ) : null}
        </table>
      </div>
    </div>
    </div>
  );
}
